import React from "react";

function CreateAreaGoal(props) {
  return (
    <div className="create-period">
      <input
        id="daily"
        type="radio"
        name="period"
        checked={props.period === "DAILY"}
        onChange={() => props.setPeriod("DAILY")}
      />
      <label htmlFor="daily">DAILY</label>
    </div>
  );
}

export default CreateAreaGoal;
